// SPDX-License-Identifier: MIT
pragma solidity ^0.8.11;

contract MateriasPrimas {

    struct MateriaPrima {
        uint id;
        uint nro_cosecha;
        string lugar_procedencia;
        string nombre_propietario;
        string gadros_brix;
        bool aprobado;
        uint createdAt;
    }

    // struct ExtraccionMosto {
    //     uint id;
    //     string tipo;
    //     bool aprobado;
    //     uint createdAt;
    // }

    // struct Pasteurizacion {
    //     uint id;
    //     string temperatura_caliente;
    //     string temperatura_fria;
    //     string tiempo_proceso;
    //     bool aprobado;
    //     uint createdAt;
    // }

    // struct Fermentacion {
    //     uint id;
    //     uint fecha_inicio;
    //     uint fecha_final;
    //     uint grados_invertidos;
    //     bool aprobado;
    //     uint createdAt;
    // }

    // struct Clarificacion {
    //     uint id;
    //     string turbidez;
    //     bool aprobado;
    //     uint createdAt;
    // }

    // struct Trasiego {
    //     uint id;
    //     uint liquido_claro;
    //     uint liquido_oscuro;
    //     bool aprobado;
    //     uint createdAt;
    // }

    // struct Envasado {
    //     uint id;
    //     uint nro_lote;
    //     uint nro_botella;
    //     bool aprobado;
    //     uint createdAt;
    // }
    
    mapping(address => mapping(uint => MateriaPrima)) public materiasPrimas;
    mapping(address => uint) public contadorMaterias;


    function crearMatriaPrima(
        uint _nro_cosecha,
        string memory _lugar_procedencia,
        string memory _nombre_propietario,
        string memory _grados_brix
    ) public {
        uint contador_id = contadorMaterias[msg.sender];

        materiasPrimas[msg.sender][contador_id] = MateriaPrima(
            contador_id,
            _nro_cosecha,
            _lugar_procedencia,
            _nombre_propietario,
            _grados_brix,
            false,
            block.timestamp
        );
       contadorMaterias[msg.sender]++;
    }

    function actualizarMatriaPrima(
        uint _id,
        uint _nro_cosecha,
        string memory _lugar_procedencia,
        string memory _nombre_propietario,
        string memory _grados_brix
    ) public {
        MateriaPrima memory _materiaPrima = materiasPrimas[msg.sender][_id];
        if (_materiaPrima.aprobado == false) {
            _materiaPrima.nro_cosecha = _nro_cosecha;
            _materiaPrima.lugar_procedencia = _lugar_procedencia;
            _materiaPrima.nombre_propietario = _nombre_propietario;
            _materiaPrima.gadros_brix = _grados_brix;
            materiasPrimas[msg.sender][_id] = _materiaPrima;
        }
    }

    function aprobarProceso(uint _id) public {
        MateriaPrima memory _materiaPrima = materiasPrimas[msg.sender][_id];
        _materiaPrima.aprobado = true;
        materiasPrimas[msg.sender][_id] = _materiaPrima;
    }
}
